Lovely Romantic Shabby Style Altered Art Chunky Charm Necklace OOAK

Lovely OOAK Chunky Charm Necklace. Silver Multi Hoop Tone Chain measuring 24" in length and once fastened measures 12" in length, a little longer when you add the longest main round Vintage Egg Oval Large Pendant, gorgeous with beautiful roses / flowers. I have added all vintage pieces even the beads are vintage or older except for the framed altered art Princess charm. That is the only charm that is newer, but I couldn't resist how perfect it looked with the Victorian Theme. The rest of the charms added are all older from Estate finds and from my Vintage Jewelry stash. More charms can always be added to this great necklace. I have added a signature "Made with Love" silver toned heart charm up by the fastener . I used a round sturdy fastener for this chunky style. 

Very pretty and shabby with all of the pearls, beads, Turquoise beads and the Large Egg Shabby floral pendant and Larger Rhinestone Cross, etc.., subtle pastels to keep it in a Victorian style . Hope you like it!.

All of my crafted jewelry is OOAK, no two will ever be the same.
