VICTORIAN ROMANTIC SHABBY VINTAGE TO MODERN JEWELRY COVERED WREATH 13"

 

This is a very pretty 13" OOAK Jewelry covered wreath. The base wreath was 12" but With the white lace trim (sorry hard to see the approximately 1 to 1 1/2" lace around the wreath due to the white lace background), it measures approximately 13". It is covered with well over 300+ pieces of Vintage and Modern jewelry. I love the way the top center middle portion has dangling pieces of jewelry... Beautiful year round. 

Keep in mind this is not a smaller 8" wreath but a 13". Many hours of attention and love have been put into this beautiful OOAK accent. It's a great size to hang above a mantle or on a focal wall. The entire wreath is covered in Jewels. It will come to you ready to hang with a sawtooth hanger. Wreath contains both complete jewelry pieces and parts of jewelry to include Rhinestones, faux pearls, pendants, antique beads, earrings, brooches, etc... Because this wreath contains many tiny pieces, beads, berries, etc., some may come loose or pop off during shipment. They can easily be reattached with a bit of glue.
