For your consideration I am offering a lovely Chip board style Shadow Box / Configuration box which is hand crafted OOAK. I have taken this compartment box which already had a lovely background of vintage keys in each compartment and added some lovely embellishments in all six compartments. Lace was added as trim and the sides and bottom of the box, which measures a tad over 8" X 8", are covered in a lovely shabby rose card stock. I have added a Moon with dangling Rhinestone, Flowers, a tag with a old fashioned lady with bonnet, a dangling pink chandelier style yo yo type flower, a silk rose and faux pearls to the edges and different parts of the outside compartments for a more 3 D effect.

Inside the compartments are: A newspaper shabby Egg with rose trim, a little miniature birds nest with glittered blue eggs, a canister of pearls with a silver crown top; a real jointed miniature burgundy teddy bear with leather pads on feet; an embellished miniature spool, buttons, a victorian yo yo flower in tan/brown; an angel holding a rose, another angel at the top with flowing dress and a miniature wooden clock in the back. A lot of time and love went into creating this piece. This box comes to you ready to hang with saw tooth hanger on back. If you would like a Pearl hanger attached, please just let me know and I will be more than happy to add for you. This piece will sit or hang. Lovely accent for any Romantic Victorian Shabby Decor.

